import './App.css';
import Title from './Components/Title';
import Post from './Components/Post';

function App() {

  let posts = [{name:'aaa',info:'dsffds'},{name:'bbb',info:'hiuijhj'},{name:'ccc',info:'fdsvsd'}];

  return (

    <div className="App">
      <Title/>
      <Post posts={posts[0].name, posts.info[0]}/>
      <Post posts={posts[1].name, posts.info[1]}/>
      <Post posts={posts[2].name, posts.info[2]}/>
    </div>
  );
}

export default App;
